/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import React from "react";
import { FaGithub, FaLinkedinIn, FaMediumM, FaInstagram } from "react-icons/fa";

const tablet = `@media (max-width: 800px)`;
const mobile = `@media (max-width: 500px)`;

const StyledIconHeader = styled.p`
  color: #aeff00;
  font-family: Kanit-Thin-Italic;
  transform: rotate(-90deg);
  padding: 10px;
`;

const AboutIconsContainer = styled.div`
  color: #aeff00;
  display: flex;
  flex-wrap: wrap;

  ${mobile} {
    margin-top: -220px;
  }
`;

function AboutIcons() {
  return (
    <AboutIconsContainer>
      <div className="linkedinIconContainer" style={{ padding: "50px" }}>
        <a
          href="https://www.linkedin.com/in/john-schriemer-7955181a1/"
          target="_blank"
          style={{ textDecoration: "none", color: "#aeff00", display: "flex" }}
        >
          <StyledIconHeader>LinkedIn</StyledIconHeader>
          WORK EXP.
          <FaLinkedinIn
            size={100}
            style={{
              color: "white",
              position: "absolute",
              marginLeft: "120px",
              marginTop: "60px",
            }}
          />
        </a>
      </div>
      <div className="githubIconContainer" style={{ padding: "50px" }}>
        <a
          href="https://github.com/jschriemer"
          target="_blank"
          style={{ textDecoration: "none", color: "#aeff00", display: "flex" }}
        >
          <StyledIconHeader>Github</StyledIconHeader>
          PROJECTS
          <FaGithub
            size={100}
            style={{
              color: "white",
              position: "absolute",
              marginLeft: "120px",
              marginTop: "60px",
            }}
          />
        </a>
      </div>
      <a
        href="https://medium.com/@jschriem"
        target="_blank"
        style={{ textDecoration: "none", color: "#aeff00" }}
      >
        <div
          className="mediumIconContainer"
          style={{ display: "flex", padding: "50px" }}
        >
          <StyledIconHeader>Medium</StyledIconHeader>
          BLOG
          <FaMediumM
            size={100}
            style={{
              color: "white",
              position: "absolute",
              marginLeft: "120px",
              marginTop: "60px",
            }}
          />
        </div>
      </a>
      <a
        href="https://www.instagram.com/jschriem/"
        target="_blank"
        style={{ textDecoration: "none" }}
      >
        <div
          className="instagramIconContainer"
          style={{ display: "flex", color: "#aeff00", padding: "50px" }}
        >
          <StyledIconHeader>Instagram</StyledIconHeader>
          PERSONAL
          <FaInstagram
            size={100}
            style={{
              color: "white",
              position: "absolute",
              marginLeft: "120px",
              marginTop: "60px",
            }}
          />
        </div>
      </a>
    </AboutIconsContainer>
  );
}

export default AboutIcons;
